}
table {
    border-collapse: collapse;
    border-spacing: 0;
}

sources.sass\\utils\\loader.scss:
$spinkit-size: 4em !default;
$spinkit-spinner-color: #337ab7 !default;

.as-loader {
    top: 0;
    left: 0;

    position: fixed;
    z-index: 999;

    min-width: 100vw;
    min-height: 100vh;

    display: flex;
    align-items: center;
    justify-content: center;

    opacity: 1;
    visibility: visible;
    transition: .3s 0s;

    &.hidden {
        opacity: 0;
        visibility: hidden;
    }
}

.sk-cube-grid {
    $delayRange: 0.4s;

    width: $spinkit-size;
    height: $spinkit-size;
    margin: auto;

    .sk-cube {
        width: 33%;
        height: 33%;
        float: left;
        animation: sk-cube-grid-scale-delay 1.3s infinite ease-in-out;
    }

    /*
     * Spinner positions
     * 1 2 3
     * 4 5 6
     * 7 8 9
     */

    .sk-cube-1 {
        animation-delay: ($delayRange * 0.50);
    }

    .sk-cube-2 {
        animation-delay: ($delayRange * 0.75);
    }

    .sk-cube-3 {
        animation-delay: $delayRange;
    }

    .sk-cube-4 {
        animation-delay: ($delayRange * 0.25);
    }

    .sk-cube-5 {
        animation-delay: ($delayRange * 0.50);
    }

    .sk-cube-6 {
        animation-delay: ($delayRange * 0.75);
    }

    .sk-cube-7 {
        animation-delay: 0s;
    }

    .sk-cube-8 {
        animation-delay: ($delayRange * 0.25);
    }

    .sk-cube-9 {
        animation-delay: ($delayRange * 0.50);
    }
}

@keyframes sk-cube-grid-scale-delay {
    0%, 70%, 100% {
        transform: scale3D(1, 1, 1);
    }
    35% {
        transform: scale3D(0, 0, 1);
    }
}

@include dark {
    .as-loader {
        background: $blue1;
    }

    .sk-cube-grid {

        .sk-cube {
            background: $orange1;
        }
    }
}

@include white {
    .as-loader {
        background: $white1;
    }

    .sk-cube-grid {

        .sk-cube {
            background: $dark1;
        }
    }
}

