sources.sass\\component\\menu.scss:
.header__nav {
    display: flex;
    height: 100%;

    margin-left: 6px;

    .menu-item {
        position: relative;
        display: flex;
        align-items: center;

        margin: 0 16px;
        transition: .3s 0s;

        border-bottom: 4px solid transparent;

        .menu-item {
            border-bottom: none;
            position: relative;

            font-size: 13px;
            font-weight: 600;
            line-height: 15px;

            transition: .3s 0s;
            margin: 0;
            padding: 8px 17px 8px 12px;

            & > .sub-menu {
                position: absolute;
                left: 100%;
                top: -40px;

                opacity: 0;
                transition: .3s 0s;
                visibility: hidden;

                padding: 8px 0;
                border-radius: 10px;
            }

            &.menu-item-has-children > a {

                &::after {
                    transform: rotate(-90deg);
                }
            }

            &:hover {

                & > a {
                    color: $orange1 !important;
                }

                & > .sub-menu {
                    top: -15px;
                    opacity: 1;

                    visibility: visible;
                }
            }
        }

        &:hover {
            & > a {
                color: $orange1 !important;
            }

            & > .sub-menu {
                top: 88px;
                opacity: 1;

                visibility: visible;
            }

            border-color: $orange1;
        }

        & > .sub-menu {
            position: absolute;
            top: 50px;
            opacity: 0;
            visibility: hidden;
            min-width: 100%;

            transition: .3s 0s;

            padding: 8px 0;

            border-bottom-left-radius: 10px;
            border-bottom-right-radius: 10px;
        }

        &.menu-item-has-children > a {
            display: flex;
            align-items: center;

            &::after {
                content: '';
                margin-left: 4px;

                width: 10px;
                height: 6px;

                border: 0 solid transparent;
            }
        }
    }

    a {
        font-size: 12px;
        font-weight: 600;
        line-height: 15px;
        white-space: nowrap;

        transition: .3s 0s;

        &:hover {
            text-decoration: none;
        }
    }
}

@include dark {
    .header__nav {

        .menu-item {

            .menu-item {

                &:hover {
                    background: $blue2;
                }
            }

            &.menu-item-has-children > a {

                &::after {
                    background: url(../assets/img/icon/arr-b.svg);
                }
            }
        }

        .sub-menu {
            background: $dark1;
        }

        a {
            color: $white;
        }
    }
}

@include white {
    .header__nav {

        .menu-item {

            .menu-item {

                &:hover {
                    background: $white2;
                }
            }

            &.menu-item-has-children a {

                &::after {
                    background: url(../assets/img/icon/arr-bblack.svg);
                }
            }
        }

        .sub-menu {
            background: $white1;
        }

        a {
            color: $black;
        }
    }
}

// 1200
@include media-breakpoint-down(xl) {
    .header__nav {
        margin-left: 4px;

        .menu-item {
            margin: 0 12px;

            &:hover {
                & > .sub-menu {
                    top: 80px;
                }
            }
        }
    }
}

// 1090
@media screen and (max-width: 1130px) {
    .header__nav {
        display: none;
    }
}

// 992
@include media-breakpoint-down(lg) {
    .header__nav {

    }
}

// 768
@include media-breakpoint-down(md) {
    .header__nav {

    }
}

// 576
@include media-breakpoint-down(sm) {
    .header__nav {

    }
}

sources.sass\\component\\mobile.scss:
.mobile {
    position: absolute;
    top: 80px;
    right: -120%;

    z-index: 4;
    transition: .3s 0s;

    width: 360px;
    border-left: 1px solid;
    height: calc(100vh - 100px);
    overflow-x: auto;

    &__body {
        margin: 12px 15px;

        & > .menu-item + .menu-item {
            border-top: 1px solid;
        }

        & > .menu-item {
            font-size: 16px;
            line-height: 22px;
            padding: 12px 0;

            & > a {
                font-weight: bold;
            }

            .sub-menu {
                a {
                    display: block;
                    margin-top: 8px;
                    opacity: .8;
                }
            }
        }
    }

    &__top {
        padding: 16px;
        border-bottom: 1px solid;

        display: flex;
        align-items: center;
        justify-content: space-between;

        &-left {
            display: flex;
            align-items: center;
        }

        &-count {
            width: 20px;
            height: 20px;

            display: flex;
            align-items: center;
            justify-content: center;
            background: $dark6;
            color: $white;
            border-radius: 50px;

            top: -5px;
            right: -5px;
            position: absolute;
        }

        &-icon {
            position: relative;
            stroke: $orange1;

            & + & {
                margin-left: 16px;
            }
        }
    }

    &__value {
        border-top: 1px solid;

        display: flex;
        padding: 16px;

        &-item {
            flex: 1 0 33.33%;

            display: flex;
            flex-direction: column;
            align-items: center;
        }

        &-image {
            margin-bottom: 4px;
        }

        &-title {
            font-family: Gilroy, sans-serif;
            font-weight: bold;
            font-size: 16px;
            line-height: 22px;
        }

        &-price {
            font-family: Gilroy, sans-serif;
            font-size: 12px;
            line-height: 16px;

            opacity: .5;
        }
    }

    &--open {
        right: 0;
    }
}

@include dark {
    .mobile {
        background: $blue1;
        border-color: rgba(255, 255, 255, 0.1);

        .menu-item,
        &__value,
        &__top {
            border-color: rgba(255, 255, 255, 0.1);
        }
    }
}

@include white {
    .mobile {
        background: $white1;
        border-color: rgba(0, 0, 0, 0.16);

        .menu-item,
        &__value,
        &__top {
            border-color: rgba(0, 0, 0, 0.16);
        }
    }
}

// 992
@include media-breakpoint-down(lg) {
    .mobile {

    }
}

// 768
@include media-breakpoint-down(md) {
    .mobile {
        top: 70px;
        height: calc(100vh - 70px);
    }
}

// 576
@include media-breakpoint-down(sm) {
    .mobile {

    }
}

@media screen and (min-width: 1130px) {
    .mobile {
        display: none;
    }
}

