        line-height: 22px;
        padding: 120px 32px 96px;

        &-list {
            margin-top: 18px;
            display: grid;

            grid-row-gap: 25px;
            grid-column-gap: 50px;
            grid-template-columns: repeat(2, auto);

            &--200 {
                grid-template-columns: repeat(2, 200px);
            }
        }

        &-header {
            display: flex;
            align-items: center;

            margin-bottom: 8px;
        }

        &-title {
            font-weight: bold;
        }

        &-link {
            margin-left: 8px;
            text-decoration-line: underline;
        }

        &-icon {
            margin-right: 4px;
        }

        &-value {
            margin-bottom: 4px;

            p + p {
                margin-top: 2px;
            }
        }

        &-text {
            opacity: .7;
            font-size: 12px;
            line-height: 16px;
        }

        &-socList {
            margin-bottom: 8px;
        }

        &-soc + &-soc {
            margin-left: 4px;
        }

        &-phone {
            height: 48px;
            display: flex;
            align-items: center;

            margin-top: 44px;

            input {
                width: 241px;
                height: 100%;

                border: 1px solid rgba(255, 255, 255, 0.7);
