    }

    &__target {
        padding: 72px 32px;
        border: 1px solid $orange1;

        position: relative;
        overflow: hidden;

        &-subtitle {
            font-weight: bold;
            font-size: 16px;
            line-height: 22px;

            margin-bottom: 16px;
        }

        &-title {
            width: 50%;
            font-size: 40px;
            line-height: 40px;
        }

        &-steep {
            display: flex;
            margin-top: 64px;
        }

        &-item {
            display: flex;
            align-items: center;

            flex: 1 0 33.33%;
        }

        &-num {
            width: 32px;
            height: 32px;

            display: flex;
            align-items: center;
            justify-content: center;

            border-radius: 50%;
            border: 1px solid $orange1;

            font-size: 16px;
            font-weight: bold;
            line-height: 22px;

            margin-right: 8px;
        }

        &-text {
            font-size: 16px;
            line-height: 22px;
        }

        &::before,
        &::after {
            content: '';
            position: absolute;

            width: 366px;
            height: 356px;

            opacity: 0.3;
            filter: blur(172px);
        }

        &::after {
            top: 0;
            left: 0;

            transform: translate(-50%, -50%);
            background: radial-gradient(60.78% 60.78% at 41.92% 39.22%, rgba(255, 217, 19, 0.4) 0%, rgba(255, 217, 19, 0) 50.52%), radial-gradient(59.58% 59.58% at 40.87% 40.42%, rgba(17, 17, 17, 0) 0%, rgba(17, 17, 17, 0) 69.79%, rgba(17, 17, 17, 0.7) 100%), linear-gradient(136.42deg, #FF1694 6.59%, #E70707 47.79%, rgba(231, 195, 7, 0) 88.05%);
        }
        &::before {
            right: 0;
            bottom: 0;

            transform: translate(50%, 50%);
            background: radial-gradient(60.78% 60.78% at 41.92% 39.22%, rgba(255, 217, 19, 0.4) 0%, rgba(255, 217, 19, 0) 50.52%), radial-gradient(59.58% 59.58% at 40.87% 40.42%, rgba(17, 17, 17, 0) 0%, rgba(17, 17, 17, 0) 69.79%, rgba(17, 17, 17, 0.7) 100%), linear-gradient(136.42deg, #FF2416 6.59%, #9FE707 47.79%, #FF4E16 88.05%);
        }
    }

    &__info {
        display: flex;
        font-size: 16px;
        line-height: 22px;

        &-item {
            flex: 1 0 33.33%;

            display: flex;
            align-items: center;

            & + & {
                border-left: 1px solid;
            }
        }

        &-body {
            padding: 120px 32px;
        }

        &-title {
            font-weight: bold;
            font-size: 32px;
            line-height: 40px;

            margin-bottom: 8px;
        }

        &-suptitle {
            color: $orange1;
            margin-bottom: 24px;
        }

        &-list {
            margin-top: 8px;
        }

        &-litem {
            display: flex;
            align-items: center;

            & + & {
                margin-top: 8px;
            }

            &:before {
                content: '';
                margin: 0 8px;
                min-width: 4px;
                min-height: 4px;

                border-radius: 50%;
                background: linear-gradient(135deg, #FF4E16 0%, #FF5A13 45.83%, #FFB90F 100%);
            }
        }

        &-contact {
            margin-top: 47px;
        }

        &-group {
            font-size: 16px;
            line-height: 22px;

