sources.sass\\component\\product\\home.scss:
.product-home {
    display: grid;
    grid-template-columns: 3fr 2fr;

    margin: 0 auto;
    max-width: 1308px;
    width: 100%;

    font-family: Gilroy, sans-serif;
    border-left: 1px solid;
    border-right: 1px solid;

    & > .breadcrumbs {
        display: none;
    }

    &__info {
        padding: 64px 32px 80px;

        &-name {
            font-weight: bold;
            font-size: 32px;
            line-height: 40px;

            margin-bottom: 16px;
        }

        &-rate {
            margin-bottom: 18px;
        }

        &-line {
            display: flex;
            align-items: center;

            margin-bottom: 25px;
        }

        &-catalog {
            font-weight: bold;
            font-size: 16px;
            line-height: 20px;

            color: $orange1;
            margin-right: 12px;
        }

        &-availability {
            display: flex;
            align-items: center;

            font-size: 16px;
            line-height: 22px;

            b {
                opacity: .5;
            }

            span {
                display: block;
                margin-left: 8px;

                &.not-available {
                    color: $red2;
                }

                &.are-available {
                    color: $green1;
                }
            }
        }

        &-input {
            width: 246px;
            margin: 32px 0 24px;
        }

        &-price {
            font-weight: bold;
            font-size: 32px;
            line-height: 40px;
        }
    }

    &__characteristics {
        margin-bottom: 24px;
        font-size: 16px;
        line-height: 22px;

        &-item {
            display: flex;
            align-items: center;

            & + & {
                margin-top: 8px;
            }
        }

        &-title {
            opacity: .5;
        }

        &-value {
            font-weight: bold;
            margin-left: 4px;
        }
    }

    &__store {
        display: flex;
        align-items: center;
        justify-content: space-between;

        font-size: 16px;
        line-height: 22px;
        padding: 12px 0;

        margin-top: 10px;
        border-top: 1px solid;
        border-bottom: 1px solid;

        &-body {
            display: flex;
            align-items: center;
        }

        &-list {
            display: flex;
            align-items: center;

            margin-left: 15px;
        }

        &-item {
            cursor: pointer;
            user-select: none;

            padding: 5px 7px;
            border: 1px solid $orange1;

            &.active {
                color: $white;
                border-color: transparent;
                background: linear-gradient(135deg, #FF4E16 0%, #FF5A13 45.83%, #FFB90F 100%);
            }

            & + & {
                margin-left: 8px;
            }
        }
    }

    &__terahash {
        $terahash: &;
        display: flex;
        align-items: flex-start;
        justify-content: space-between;

        padding: 20px 0;
        font-size: 16px;
        line-height: 22px;
        border-top: 1px solid;
        border-bottom: 1px solid;

        &-list {
            margin-top: 8px;
        }

        &-item {
            display: flex;
            align-items: center;

            &::before {
                content: '';

                background: $orange1;
                min-height: 5px;
                min-width: 5px;

                margin: 7px 5px;
                border-radius: 50%;
            }

            &:not(.isThis) {

                #{$terahash} {

                    &-value {
                        opacity: 1;
                        color: $orange1;
                    }
                }

                &::before {
                    background: $white3;
                }
            }

            & + & {
                margin-top: 8px;
            }
        }

        &-title {
            font-weight: bold;
            margin-right: 4px;
        }

        &-value {
            opacity: .5;
        }
    }

    &__buy {
        display: flex;
        align-items: flex-end;

        gap: 32px;

        &-btn {
            width: 220px;
            height: 56px;
        }

        &-one {
            width: 100%;

            label {
                display: block;
                font-weight: 600;
                font-size: 16px;
                line-height: 22px;

                margin-bottom: 8px;
            }
        }

        &-input {
            display: flex;
            align-items: center;

            .input {
                border-right: none;
            }
        }

        &-oneclick {
            width: 125px;
        }
    }

    &__image {
        $height: 95px;
        border-left: 1px solid;

        padding: 155px 60px 0;

        &-body {
            user-select: none;
            display: flex;

            width: 100%;
            height: 315px;
            transition: .3s 0s;

            img {
                width: 100%;
                margin: 0 auto;
            }

            &.hide {
                opacity: 0;
            }
        }

        &-thumb {
            user-select: none;
            margin-top: 30px;

            display: flex;
            align-items: center;
            gap: 12px;
        }

        &-arr {
            width: 24px;
            height: $height;

            border: 1px solid;
            cursor: pointer;

            display: flex;
            align-items: center;
            justify-content: center;
            transition: .3s 0s;
        }

        &-list {
            display: flex;
            gap: 16px;

            transition: .3s 0s;
        }

        &-item {
            min-width: $height;
            min-height: $height;
            border: 1px solid;
            cursor: pointer;

            display: flex;
            align-items: center;
            justify-content: center;
            transition: .3s 0s;

            img {
                width: 100%;
            }

            &.active {
                border-color: $orange1 !important;
            }
        }

        &-bodylist {
            flex: 1;
            overflow: hidden;
            max-width: 317px;
        }
    }
}

@include dark {
    .product-home {
        color: $white;
        border-color: rgba(255, 255, 255, 0.1);

        &__image {

            &-item,
            &-arr {
                border-color: rgba(255, 255, 255, 0.1);
            }

            &-arr {

                &:hover {
                    background: $dark1;
                }
            }
        }

        &__terahash,
        &__store,
        &__image {
            border-color: rgba(255, 255, 255, 0.1);
        }
    }
}
@include white {
    .product-home {
        color: $black;
        border-color: rgba(0, 0, 0, 0.16);

        &__image {

            &-item,
            &-arr {
                border-color: rgba(0, 0, 0, 0.16);
            }

            &-arr {

                &:hover {
                    background: $white1;
                }
            }
        }

        &__terahash,
        &__store,
        &__image {
            border-color: rgba(0, 0, 0, 0.1);
        }
    }
}

// 1200
@include media-breakpoint-down(lg) {
    .product-home {
        margin: 0 20px;
        width: auto;

        &__info {
            padding: 60px 26px 80px;

            &-name {
                font-size: 30px;
                line-height: 38px;
            }

            &-input {
                width: 246px;
                margin: 32px 0 24px;
            }
        }

        &__image {
            padding: 130px 30px 0;

            &-body {
                height: 300px;
            }

            &-thumb {
                margin-top: 30px;
                gap: 12px;
            }
        }
    }
}

// 992
@include media-breakpoint-down(md) {
    .product-home {
        margin: 0 15px;
        display: flex;
        flex-direction: column;

        & > .breadcrumbs {
            display: flex;
            padding: 40px 16px 18px;
        }

        &__info {
            padding: 24px 26px 64px;
            order: 1;

            &-name {
                font-size: 28px;
                line-height: 36px;
            }

            &-input {
                width: 246px; // 576
                margin: 24px 0 40px;
            }

            & > .breadcrumbs {
                display: none;
            }
        }

        &__characteristics {

            &-value {
                margin-left: 2px;
            }
        }

        &__store {
            padding: 16px 0;
        }

        &__terahash {
            $terahash: &;
            padding: 16px 0;

            &-title {
                margin-right: 2px;
            }
        }

        &__buy {
            gap: 14px;

            &-btn {
                width: 240px;
                height: 48px;
            }
        }

        &__image {
            $height: 95px;
            padding: 0 26px 0;
            order: 0;

            &-body {
                height: 260px;

                img {
                    width: auto;
                }
            }

            &-thumb {
                display: flex;
                justify-content: center;

                margin-top: 25px;
                gap: 20px;
            }

            &-arr {
                width: 30px;
                height: $height;
            }

            &-list {
                gap: 16px;
            }

            &-item {
                min-width: $height;
                min-height: $height;
            }

            &-bodylist {
                max-width: 317px;
            }
        }
    }
}

// 768
@include media-breakpoint-down(sm) {
    .product-home {
        margin: 0 10px;

        &__info {
            padding: 24px 18px 64px;

            &-name {
                font-size: 26px;
                line-height: 32px;
            }
        }

        &__store {
            align-items: flex-start;

            &-body {
                align-items: flex-start;
                flex-direction: column;
            }

            &-list {
                margin-top: 13px;
                margin-left: 0;
            }

            &-item {
                padding: 5px;
            }
        }

        &__buy {
            flex-direction: column;
            align-items: flex-start;

            gap: 40px;
            margin-top: 16px;

            &-btn {
                width: 100%;
                height: 48px;
            }
        }

        &__image {
            $height: 70px;
            padding: 0 18px 0;

            &-body {
                height: 240px;
            }

            &-thumb {
                margin-top: 16px;
                gap: 14px;
            }

            &-arr {
                width: 20px;
                height: $height;
            }

            &-list {
                gap: 10px;
            }

            &-item {
                min-width: $height;
                min-height: $height;
            }

            &-bodylist {
                max-width: 230px;
            }
        }
    }
}

// 576
@media screen and (max-width: 576px) {
    .product-home {

        &__info {
            padding: 24px 8px 64px;

            &-input {
                width: 100%;
            }
        }

        &__image {
            padding: 0 8px 0;

            &-body {
                height: 210px;
            }

            &-thumb {
                gap: 6px;
            }
        }
    }
}

