                border-color: rgba(0, 0, 0, 0.16);
            }
        }
    }
}

// 1200
@include media-breakpoint-down(lg) {
    .catalog-home {
        width: auto;
        margin: 0 20px;

        &__info {
            padding: 100px 26px 75px;

            &-title {
                font-size: 42px;
                line-height: 54px;

                margin-bottom: 4px;
            }
        }

        &__list {

            &-icon {
                margin-right: 14px;
            }

            &-item {
                padding: 30px 26px;
            }
        }
    }
}

// 992
@include media-breakpoint-down(md) {
    .catalog-home {
        margin: 0 15px;

        &__info {
            padding: 50px 20px 24px;

            &-title {
                font-size: 38px;
                line-height: 46px;

                margin-bottom: 0;
            }
        }

        &__list {
            grid-template-columns: repeat(1, 1fr);

            &-item {
                padding: 26px 22px;

                & + & {
                    border-left: none;
                    border-top: 1px solid;
                }
            }
        }

        &__image {
            display: none;
        }

        &::before,
        &::after {
            display: none;
        }
    }
}

// 768
@include media-breakpoint-down(sm) {
    .catalog-home {
        margin: 0 10px;

        &__info {
            padding: 50px 12px 24px;

            &-title {
                font-size: 26px;
                line-height: 34px;
            }
        }

        &__list {

            &-item {
                padding: 22px 14px;
            }
        }
    }
}

// 576
@media screen and (max-width: 576px) {
    .catalog-home {

    }
}

